    address public bridge;
    string private baseTokenURI;

    constructor(string memory baseURI) ERC721("SmolBirb", "BIRB") {
        baseTokenURI = baseURI;
    }

    modifier onlyBridge() {
        require(msg.sender == bridge, "Caller not bridge");
        _;
    }

    function setBaseURI(string calldata baseURI) external onlyOwner {
        baseTokenURI = baseURI;
    }

    function setBridgeContract(address _bridgeAddress) external onlyOwner {
        require(_bridgeAddress != address(0), "ZERO_ADDRESS");
        bridge = _bridgeAddress;
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    function mint(address account, uint256[] calldata tokenIds)
